import Head from 'next/head';
import NavBar from './navbar';
import Footer from './footer';

const Layout = (props) => (
    <div>
        <Head>
            <title>
                Muhalik
            </title>
        </Head>
        <NavBar />
        {props.children}
        <br/>
        <Footer/>
    </div>
);

export default Layout;
